class SeatManager:

    def __init__(self, n: int):
        self.available = [True] * n
        self.min = 0

    def reserve(self) -> int:
        seat = self.min + 1
        self.available[self.min] = False
        while (not self.available[self.min]) and self.min < len(self.available):
            self.min += 1
        return seat

    def unreserve(self, seatNumber: int) -> None:
        self.available[seatNumber] = True
        if self.min > seatNumber:
            self.min = seatNumber

